// Voeg het woord toe aan de lijst 
function voegToeAanLijst(woord, tekst) {
    var ul = document.getElementById("lijstje");
    var a = document.createElement("a");
    var br = document.createElement("br");
    var linkText = document.createTextNode(tekst);
    a.appendChild(linkText);
    a.title = woord;
    a.href = woord;
    ul.appendChild(a);
    ul.appendChild(br)

}
